import React from 'react';

export class Video extends React.Component {
  render() {
    return (
      <div>
        {/* give <video /> a src attribute equal to the passed-in video file. */}
        <iframe width="560" height="315" src="https://www.youtube.com/embed/-5CdAup0o-I" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>      </div>
    );
  }
}
